import React from "react"
import NavBar from "./NavBar"

import Page1 from "./adpage1";
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";

function App() {
    return (
        <Router>
        <div>
            <NavBar />
            <Route path="/adpage1" component={Page1} />
        </div>
        </Router>
        )
}

export default App
